import "./App.css";
import Education from "./Education";
import Experience from "./Experience";
import Header from "./Header";
import Projects from "./Projects";

function App() {
  return (
    <div className="App">
      <Header />
      <Projects />
      <Education />
      <Experience />
    </div>
  );
}

export default App;
